import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';

function Note(props) {

  function handleDeleteNote() {
    props.onDelete(props.id);  
  }

  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      { props.id === 0 ? <button>EXAMPLE NOTE </button> :<button onClick={handleDeleteNote} >
        <DeleteIcon />
      </button> }
    </div>
  );
}

export default Note;
